EU JÁ IRIA VOTAR NO BOLSONARO, ATÉ DESCOBRIR QUE:

1- OS QUE CRITICAM NUNCA ME MOSTRAM UM MELHOR;

2- QUANDO VI QUE SEUS INIMIGOS ERAM, NATURALMENTE, OS MEUS INIMIGOS: GLOBO, VAGABUNDOS, BANDIDOS DE FACÇÕES, POLÍTICOS CORRUPTOS, LULA, DILMA, TEMER E AFINS;

3- É O ÚNICO QUE TEM CORAGEM DE DESAFIAR A MÍDIA TRADICIONAL
(COMEÇOU BEM);

4- VAI INDICAR O JUIZ MORO PARA O SUPREMO TRIBUNAL FEDERAL, PARA QUE OS PROCESSOS PARADOS SEJAM AGILIZADOS E PARA QUE AS PAUTAS PROGRESSISTAS SEJAM DEBATIDAS, E NÃO APROVADAS DE IMEDIATO (ESSENCIAL!);

5- É A FAVOR DA REDUÇÃO DA MAIORIDADE PENAL (EU TAMBÉM);

6- É CONTRA A IDEOLOGIA DE GÊNERO (EU TAMBÉM!);

7- NÃO GOSTA DA GLOBO (EU TAMBÉM NÃO!);

8- É CONTRA A LIBERAÇÃO DAS DROGAS (EU TAMBÉM!);

9- QUER REDUZIR OS IMPOSTOS, COMO FEZ O DONALD TRUMP (CONCORDO);

10- QUER ABRIR ESCOLAS MILITARES, NO LUGAR DE UPP'S (MELHOR IDÉIA EXEQUÍVEL);

11- QUER PRIVATIZAR ESTATAIS, COM EXCEÇÄO DAS ESTRATÉGICAS (TAMBÉM CONCORDO!);

12- NÃO VAI FINANCIAR O ABORTO, COM DINHEIRO DO GOVERNO (MARAVILHA);

13- VALORIZA E QUER INVESTIR NA LAVA-JATO (DEMAIS!);

14- ACHA QUE O PROFESSOR DEVE TER PLENOS DIREITOS EM SALA DE AULA, E OS ALUNOS, PLENOS DEVERES, COMO ERA ANTIGAMENTE (PERFEIÇÃO);

15- QUER SE APROXIMAR DE ISRAEL, E ACHA QUE PODE IMPORTAR CONHECIMENTO, PARA IRRIGAR O NORDESTE, DESSALINIZANDO ÁGUA DO MAR (UM SONHO!);

16- É FICHA LIMPA (BÁSICO PARA QUALQUER PRESIDENTE);

17- NÃO É REFÉM DE GRITOS E DE ESTARDALHAÇO DE MILITANTES (MARAVILHA!);

18 - QUER APROXIMAR O MINISTÉRIO DA TECNOLOGIA E CIÊNCIA, DA NASA, INDICANDO O ASTRONAUTA PARA A PASTA (INTELIGÊNCIA PURA!);

19- NÃO GOSTA DO ATUAL MODELO DOS DIREITOS HUMANOS (EU TAMBÉM NÃO!);

20- ACHA QUE VAGABUNDO DEVE FICAR PRESO DE FATO, SEM AUDIÊNCIA DE CUSTÓDIA (EU TAMBÉM);

21- VALORIZA A LIBERDADE DAS REDES SOCIAIS E DE VÁRIOS OUTROS CANAIS DE TV, COM OS QUAIS A GLOBO DISPUTA ESPAÇO (MUITO LEGAL!);

22 - DEMONSTROU QUE NÃO É PRECISO GASTAR GRANDES QUANTIAS PARA FAZER CAMPANHA (ÓTIMO!);

23- VAI MUDAR O ESTATUTO DO DESARMAMENTO (COMO ERA ANTIGAMENTE, COM RESSALVAS!);

24- DEFENDE A CASTRAÇÃO QUÍMICA PARA QUEM ESTUPRAR MULHERES E CRIANÇAS (PERFEITO!);

25- É A FAVOR DE COTAS SOCIAIS, E NÃO DE COTAS RACIAIS (EU TAMBÉM!);

26- VAI INDICAR UM DOS MELHORES ECONOMISTAS PARA A PASTA DE ECONOMIA, UM LIBERAL NATO (E, COMO NÃO ENTENDE DE ECONOMIA, CERTAMENTE DEIXARÁ PAULO GUEDES TRABALHAR EM PAZ);

27- VAI COLOCAR OLAVO DE CARVALHO COMO MINISTRO OU SECRETÁRIO DA CULTURA (REZO POR ISSO TODO DIA!);

28- É O ÚNICO QUE CHEGARÁ DE FORMA INDEPENDENTE AO PLANALTO, SEM FAZER CONCHAVOS, OU ACORDOS ESPÚRIOS, COM PARTIDOS POLÍTICOS CORRUPTOS, PARA GOVERNAR (PRINCIPAL DE TUDO).

É POR TUDO ISSO, QUE EU VOTAREI NESSE CARA!!!!

